output = input.split('\n')
    .map(y => 
    {
        let x = y.split(':');
        x[0] = x[0].includes('?') 
            ? x[0] 
            : `${x[0]}?`;
        x[1] = x[1].includes('null')
            ? x[1] 
            : `${x[1].replace(';','')} | null;`;
        return x.join(':');
